        SellFee = 0;
        marketingWallet = _wallet;
        routerAddress = Router(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
        isTaxFree[address(this)] = true;
        _mint(_wallet, _totalSupply * 10**9);
        swapLimit = 10000 *10**9;
    }


    function includeExcludeFee(
        address userAddress,
        bool isFeeFree
    ) external onlyOwner {
        isTaxFree[userAddress] = isFeeFree;
        emit ManageUserFee(userAddress, isFeeFree);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
     ) internal override {
        require(from != address(0), "ERROR: Zero Address");
        require(to != address(0), "ERROR: Zero Address");
        require(amount != 0, "ERROR: Zero Amount");
        uint256 contractBalance = balanceOf(address(this));

        if (
            contractBalance >= swapLimit &&
            !isPairAddress[from] &&
            !isSwapEnabled
        ) {
            isSwapEnabled = true;
            swapTokensForEth(contractBalance);
            isSwapEnabled = false;
        }

        if (isPairAddress[from] || isPairAddress[to]) {
            transfers(from, to, amount);
        } else {
            super._transfer(from, to, amount);
        }
    }

    function transfers(address from, address to, uint256 amount) internal {
        if (
            from == owner() || to == owner() || isTaxFree[from] || isTaxFree[to]
        ) {
            super._transfer(from, to, amount);
        } else {
            require(isTradingEnable,"Trading Disabled");
            uint256 feeAmount;
            uint256 finalAmount;
            if (isPairAddress[from])
                (feeAmount, finalAmount) = getamount(amount, true);
            else (feeAmount, finalAmount) = getamount(amount, false);
            super._transfer(from, to, finalAmount);
            super._transfer(from, address(this), feeAmount);
        }
    }

    function getamount(
        uint256 amount,
        bool isBuy
    ) internal view returns (uint256, uint256) {
        uint256 feeAmount;
        if (isBuy) feeAmount = (amount * BuyFee) / 100;
        else feeAmount = (amount * SellFee) / 100;
        uint256 finalAmount = amount - feeAmount;
        return (feeAmount, finalAmount);
    }

    function swapTokensForEth(uint256 tokenAmount) internal {
        uint256 initialBalance = address(this).balance;
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = routerAddress.WETH();

        _approve(address(this), address(routerAddress), totalSupply());

        // make the swap
        // Marketing Wallet will only wallet not contract address
        routerAddress.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of BNB
            path,
            address(this),
            block.timestamp + 60
        );

        uint256 newBalance = address(this).balance - initialBalance;
        payable(marketingWallet).sendValue(newBalance);
    }

    function setPairAddress(address _pairAddress) external onlyOwner {
        require(_pairAddress != address(0) && isContract(_pairAddress), "ERROR: Invalid PairAddress");
        isPairAddress[_pairAddress] =true;
        isTradingEnable = true;
        emit SetPair(_pairAddress);
    }

    function isContract(address addr) internal view returns (bool) {
        uint size;
        assembly {
            // Retrieve the size of the code at the given address
            size := extcodesize(addr)
        }
        // Check if the code size is greater than 0, indicating it is a contract
        return size > 0;
    }

    function buyFee(uint256 _buyFee) external onlyOwner {
        require(_buyFee <= 40, "ERROR: Max Tax Limit");
        BuyFee = _buyFee;
        emit SetFee(_buyFee);
    }

    function sellFee(uint256 _sellFee) external onlyOwner {
        require(_sellFee <= 40, "ERROR: Max Tax Limit");
        SellFee = _sellFee;
        emit SetFee(_sellFee);
    }

    function _swapLimit(uint256 limit) external onlyOwner {
        require(limit >= 100 *10**9 && limit < totalSupply(), "ERROR: Limit Exceeds");
        swapLimit = limit;
        emit SetSwapLimit(limit);
    }
  
    function setWallet(address _newWallet)external onlyOwner{
        require(_newWallet!=address(0),"ERROR: Should not be Zero Address");
        marketingWallet=_newWallet;
        emit SetWallet(_newWallet);
    }

    function enableTrading(bool _enableTrading)external onlyOwner{
        isTradingEnable =_enableTrading;
        emit EnableTrading(_enableTrading);
    }

}
